import React from 'react';
import './SecondaryButton.scss';
import { Link } from 'react-router-dom';

function SecondaryButton({link, isLnkt, icon, text, iconOption, bntId }){
    return(
        <Link className='secondary-button' to={link}>
            <img src={icon} alt="Button icon" className={`secondary-button__icon brainflix_icon_lg ${prop.iconOption}`} />
            <p className='secondary-button__text'>{prop.text}</p>
        </Link>
    );
}

export default SecondaryButton;
